import React from "react";
import settings from "../../../img/icon_settings.png";
import stg from "../Messages/Messages.module.css";

const Settings = () => {
    return (
        <div>
            <a><img className={stg.img} src={settings} alt="settings"/></a>
        </div>
    );
}

export default Settings;
